import React, { useState } from "react";
import { Container, Typography, Box, Avatar, Paper } from "@mui/material";
import profileimage from "../assets/profileimage.jpeg";

export default function RightPane() {
  const [clicked, setClicked] = useState(false);

  function handleClick() {
    setClicked(true);
  }

  return (
    <div
      style={{
        backgroundColor: "teal",
        maxWidth: 300,
        minWidth: 200,
        paddingTop: 20,
      }}
    >
      <div>
        <h3>Menu</h3>
      </div>

      <Container>
        <ul>
          <li>
            <Typography
              variant="body1"
              textAlign={"left"}
              onClick={handleClick}
            >
              Home
            </Typography>
          </li>
          <li>
            <Typography
              variant="body1"
              textAlign={"left"}
              onClick={handleClick}
              style={{ color: clicked ? "red" : "inherit" }}
            >
              My Projects
            </Typography>
          </li>
          <li>
            <Typography variant="body1" textAlign={"left"}>
              Contact me
            </Typography>
          </li>
        </ul>
      </Container>
    </div>
  );
}
